// File: contracts/SoulboundSecurity.sol


pragma solidity ^0.8.4;







 
contract SoulBoundSecurity is ERC721, ERC721URIStorage, Ownable {

    event ProjectAdded(string projectName);
    
    using Counters for Counters.Counter;
 
    Counters.Counter private _tokenIdCounter;
 
    constructor() ERC721("SoulBoundSecurity", "SBS") {}

    uint fee = 5000000000000000000;

    struct Project {
        string name;
        address owner;
        bool active;
        uint[] tokenIds;
        uint nextPaymentDue;
    }

    mapping (uint => string) public tokenProjects;//maps tokenId to project name
    mapping (string => Project) public projects;//maps project name to project structure
    mapping (address => bool) public allowTokens;//controls which tokens accepted for payment

    function allowToken(address _token) public onlyOwner
    {
        allowTokens[_token] = true;
    }

    function removeToken(address _token) public onlyOwner
    {
        allowTokens[_token] = false;
    }

    function changeProjectOwner(string memory projectName, address ownerAddr) public onlyOwner
    {
        projects[projectName].owner = ownerAddr;
    }

    function updateProjectStatus(string memory projectName, bool active) public onlyOwner
    {
        projects[projectName].active = active;
    }

    function setFee(uint _fee) public onlyOwner
    {
        fee = _fee;
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId, uint256 batchSize) internal override(ERC721)
    {
        require(from == address(0), "Token not transferable");
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function _projectOwner(address _addr, string memory project) private returns (bool)
    {
        return _addr == owner() || projects[project].owner == _addr;
    }

    function _getTokenURI(uint256 tokenId, string memory project) private returns (string memory)
    {
        bytes memory dataURI = abi.encodePacked(
            '{',
                '"name": "SoulBoundSecurity - ', project,'",',
                '"description": "SoulBoundSecurity Token",',
            '}'
        );
        return string(abi.encodePacked("data:application/json;base64,", Base64.encode(dataURI)));
    }
 
    function mint(address to, string memory projectName) public 
    {
        require(_projectOwner(msg.sender, projectName), "Minting only available to contract owner or project owner");
        uint256 tokenId = _tokenIdCounter.current();
        tokenProjects[tokenId] = projectName;
        projects[projectName].tokenIds.push(tokenId);
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        _setTokenURI(tokenId, _getTokenURI(tokenId, projectName));
    }

    function createProject(string memory projectName, address projectOwner) public onlyOwner
    {
        projects[projectName].name = projectName;
        projects[projectName].owner = projectOwner;
        projects[projectName].active = true;
        projects[projectName].nextPaymentDue = block.timestamp+(60*60*24*30);
        mint(projectOwner, projectName);
        emit ProjectAdded(projectName);
    }

    function makePayment(address _token, uint _amt, string memory projectName) public
    {
        //make payment for project
        require(_projectOwner(msg.sender, projectName), "Must be project owner");
        require(allowTokens[_token] == true, "Token is not supported");
        require(_amt == fee, "Please pay required amount");
        require(IERC20(_token).allowance(msg.sender, address(this)) >= fee, "Not approved to send balance requested");
        bool success = IERC20(_token).transferFrom(msg.sender, address(this), _amt);
        require(success, "Transaction was not successful");
        projects[projectName].nextPaymentDue = projects[projectName].nextPaymentDue + (60*60*24*30);
    }

    function burn(uint256 tokenId) public 
    {
        require(_projectOwner(msg.sender, tokenProjects[tokenId]), "Burning only available to contract owner or project owner");
        _burn(tokenId);
    }

    // The following functions are overrides required by Solidity.

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721, ERC721URIStorage) returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
 
    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage)
    {
        super._burn(tokenId);
    }
 
    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory)
    {
        return super.tokenURI(tokenId);
    }
}

